(381, 55, 'columns_content_0_column_0_content', '<img class=\"aligncenter size-full wp-image-53\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu.png\" alt=\"cold-and-flu\" width=\"486\" height=\"382\" />\r\n<h3 class=\"p1\" style=\"text-align: center;\">Perrigo Cold &amp; Flu Tablets</h3>\r\n<p class=\"p1\" style=\"text-align: center;\">These tablets are used for the relief of symptoms of colds and flu, including aches and pains, headache, blocked nose, sore throat, chills and chesty coughs.</p>\r\n<p class=\"p1\" style=\"text-align: center;\">Perrigo Cold &amp; Flu tablets contains paracetamol 250mg, Guaifenesin 100mg and Phenylephrine 5mg. For the symptomatic relief of colds &amp; flu. Always read the label.</p>'),
