(466, 58, 'columns_content_0_column_1_content', '<img class=\"aligncenter size-full wp-image-54\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-multi-relief.png\" alt=\"cold-and-flu-multi-relief\" width=\"490\" height=\"384\" />\r\n<h3 style=\"text-align: center;\">Perrigo Cold &amp; Flu Multi-Relief Capsules</h3>\r\n<p style=\"text-align: center;\">These capsules are used for the relief of the symptoms of colds and flu and the pain and congestion of sinusitis, including aches and pains, headache, blocked nose and sore throat, chills and feverishness (high temperature).</p>\r\n<p style=\"text-align: center;\">They can also loosen stubborn mucus (phlegm)\r\nand provide relief from chesty coughs.</p>\r\n<p style=\"text-align: center;\">Perrigo Cold &amp; Flu Multi Relief Capsules contains paracetamol 500mg, Guaifenesin 100mg and Phenylephrine 6.1mg. For the symptomatic relief of colds &amp; flu. Always read the label.</p>'),
