(602, 62, 'columns_content_1_column_1_content', '<img class=\"aligncenter size-full wp-image-60\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-oral.png\" alt=\"cold-and-flu-oral\" width=\"446\" height=\"383\" />\r\n<h3 style=\"text-align: center;\">Perrigo Cold &amp; Flu Oral Solution</h3>\r\n<p style=\"text-align: center;\">This medicine is used for the short-term relief of the symptoms of colds and ¬flu, including aches and pains, such as headache and sore throat, nasal congestion, chills and feverishness\r\n(high temperature).</p>\r\n<p style=\"text-align: center;\">Loosens stubborn mucus (phlegm) and provides relief from chesty coughs, in adults and children aged 12 years and over. This medicine should only be used if you have all of the following symptoms\r\n– pain and/or fever, a blocked nose and\r\na chesty cough.</p>\r\n<p style=\"text-align: center;\">Perrigo Cold &amp; Flu powered oral solution contains paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu.\r\nAlways read the label.</p>'),
