(665, 63, 'pre_footer', '<p class=\"p1\"><b>If symptoms persist consult your healthcare professional. All information presented on these web pages is not meant to diagnose or prescribe. In all health matters for further advice please speak to your doctor or pharmacist. </b></p>\r\n<p class=\"p1\">Perrigo Paracetamol 500mg Film-coated tablets contain Paracetamol. For the treatment of mild to moderate pain. Always read the leaflet.\r\nPerrigo Ibuprofen 200mg coated tablets contain Ibuprofen. For Pain Relief. Always read the label.\r\nPerrigo Cold &amp; Flu powered oral solution contains paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu. Always read the label.\r\nPerrigo Cold &amp; Flu tablets contains paracetamol 250mg, Guaifenesin 100mg and Phenylephrine 5mg. For the symptomatic relief of colds &amp; flu. Always read the label.\r\nPerrigo Cold &amp; Flu Multi Relief Max Powder Oral Solution contains paracetamol 1000mg, Guaifenesin 200mg and Phenylephrine 12.2mg. For the symptomatic relief of colds &amp; flu. Always read the label.\r\nPerrigo Cold &amp; Flu Multi Relief Capsules contains paracetamol 500mg, Guaifenesin 100mg and Phenylephrine 6.1mg. For the symptomatic relief of colds &amp; flu. Always read the label.</p>'),
(666, 63, '_pre_footer', 'field_5b11326b73669'),
(667, 24, 'pre_footer', '<strong>Perrigo Cold and Flu products contain paracetamol, guaifenesin and phenylephrine. For the relief of cold and flu symptoms and chesty cough. Do not take with any other paracetamol-containing products or with any other flu, cold, decongestant products or cough suppressants. Always read the leaflet.</strong>'),
