(806, 8, 'pre_footer', '<strong>*Ibuprofen is targeted pain relief and paracetamol is effective pain relief</strong>\r\n\r\n<strong>Perrigo Cold and Flu products contain paracetamol, guaifenesin and phenylephrine. For the relief of cold and flu symptoms and chesty cough. Do not take with any other paracetamol-containing products or with any other flu, cold, decongestant products or cough suppressants. Always read the leaflet.</strong>\r\n\r\n<strong>Paracetamol 500mg Film-coated Tablets. For the short term management of pain. Always read the leaflet.</strong>\r\n\r\n<strong>Ibuprofen 200mg Coated Tablets. For short term symptomatic relief of mild to moderate pain. Always read the leaflet.</strong>'),
