(1044, 90, '_columns_content_0_column_1_title', 'field_5b1122ce98d31'),
(1045, 90, 'columns_content_0_column_1_content', '<img class=\"aligncenter size-full wp-image-67\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/ibuprofen.png\" alt=\"ibuprofen\" width=\"463\" height=\"383\" />\r\n<h3 style=\"text-align: center;\">Perrigo Ibuprofen 200mg Coated Tablets</h3>\r\n<p style=\"text-align: center;\">For the short-term relief of mild to moderate\r\npain such as headache, period pain, dental pain,\r\nand fever and pain associated with the common cold.</p>\r\n<p style=\"text-align: center;\">You must talk to a doctor if you do not feel better or if you feel worse after 3 days with fever\r\nand 4 days with pain.</p>\r\n<p style=\"text-align: center;\">Perrigo Ibuprofen 200mg coated tablets contain Ibuprofen. For Pain Relief. Always read the label.</p>'),
