(1089, 91, 'columns_content_1_column_0_content', '<img class=\"aligncenter size-full wp-image-59\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-multi-relief-oral.png\" alt=\"cold-and-flu-multi-relief-oral\" width=\"444\" height=\"382\" />\r\n<h3 style=\"text-align: center;\">Perrigo Cold &amp; Flu Multi-Relief Max Oral Solution</h3>\r\n<p style=\"text-align: center;\">These sachets are used for the relief of the symptoms of colds and ¬flu and the pain and congestion of sinusitis, including aches and pains, headache, blocked nose and sore throat, chills and feverishness (high temperature).</p>\r\n<p style=\"text-align: center;\">They can also loosen stubborn mucus (phlegm)\r\nand provide relief from chesty coughs.</p>\r\n<p style=\"text-align: center;\">Perrigo Cold &amp; Flu Multi Relief Max Powder Oral Solution contains paracetamol 1000mg, Guaifenesin 200mg and Phenylephrine 12.2mg. For the symptomatic relief of colds\r\n&amp; flu. Always read the label.</p>'),
