(1161, 96, 'pre_footer', '<strong>If symptoms persist consult your healthcare professional. All information presented on these web pages is not meant to diagnose or prescribe. In all health matters for further advice please speak to your doctor or pharmacist.</strong>\r\n\r\n<strong>Perrigo Paracetamol 500mg Film-coated tablets contain Paracetamol. For the treatment of mild to moderate pain. Always read the leaflet. Perrigo Ibuprofen 200mg coated tablets contain Ibuprofen. For Pain Relief. Always read the label.</strong>\r\n<strong>Perrigo Cold &amp; Flu powered oral solution contains paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu. Always read the label.</strong>\r\n<strong>Perrigo Cold &amp; Flu tablets contains paracetamol 250mg, Guaifenesin 100mg and Phenylephrine 5mg. For the symptomatic relief of colds &amp; flu. Always read the label.</strong>\r\n<strong>Perrigo Cold &amp; Flu Multi Relief Max Powder Oral Solution contains paracetamol 1000mg, Guaifenesin 200mg and Phenylephrine 12.2mg. For the symptomatic relief of colds &amp; flu. Always read the label.</strong>\r\n<strong>Perrigo Cold &amp; Flu Multi Relief Capsules contains paracetamol 500mg, Guaifenesin 100mg and Phenylephrine 6.1mg. For the symptomatic relief of colds &amp; flu. Always read the label.</strong>'),
