(1169, 97, '_columns_content_0_column_0_title', 'field_5b1122ce98d31'),
(1170, 97, 'columns_content_0_column_0_content', '<img class=\"size-full wp-image-66 alignleft\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/paracetamol.png\" alt=\"paracetamol\" width=\"455\" height=\"375\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3 class=\"p1\">Perrigo Paracetamol\r\n500mg Film-Coated Tablets</h3>\r\nThis medicine is used for relief of headaches, including migraine and tension headaches, toothache, backache, rheumatic and muscle pains, neuralgia and period pain.\r\n\r\nIt also relieves feverishness, aches and pains of colds and flu. The active ingredient is paracetamol which is a painkiller and reduces your temperature when you have a fever.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Paracetamol 500mg Film-coated Tablets contain Paracetamol.\r\nFor pain relief. Always read the leaflet.</p>'),
(1171, 97, '_columns_content_0_column_0_content', 'field_5b1122d698d32'),
(1172, 97, 'columns_content_0_column_1_title', 'Ibuprofen'),
(1173, 97, '_columns_content_0_column_1_title', 'field_5b1122ce98d31'),
(1174, 97, 'columns_content_0_column_1_content', '<img class=\"size-full wp-image-67 alignleft\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/ibuprofen.png\" alt=\"ibuprofen\" width=\"463\" height=\"383\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3>Perrigo Ibuprofen\r\n200mg Coated Tablets</h3>\r\nThis medicine is used for the short-term  relief of mild to moderate pain such as headache, period pain, dental pain, and fever and pain associated with the common cold.\r\n\r\nYou must talk to a doctor if you do not feel better or if you feel worse after 3 days with fever and 4 days with pain.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Ibuprofen 200mg coated tablets contain Ibuprofen.\r\nFor Pain Relief. Always read the leaflet.</p>'),
