(1256, 107, 'columns_content_0_column_1_content', '<img class=\"alignnone wp-image-104 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-multi-relief-1-300x233.png\" alt=\"cold-and-flu-multi-relief\" width=\"300\" height=\"233\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n 	<li>Sore Throat</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu\r\nMulti-Relief Capsules</h3>\r\nThis medicine is used for the relief of the symptoms of colds and flu and the pain and congestion of sinusitis, including aches and pains, headache, blocked nose and sore throat, chills and feverishness (high temperature). It can also loosen stubborn mucus (phlegm) and provide relief from chesty coughs.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Multi Relief Capsules contains Paracetamol 500mg, Guaifenesin 100mg and Phenylephrine 6.1mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.</p>'),
