(1304, 109, 'columns_content_0_column_0_content', '<img class=\"wp-image-103 size-medium alignnone\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-1-300x232.png\" alt=\"cold-and-flu\" width=\"300\" height=\"232\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n</ul>\r\n<h3></h3>\r\n<h3 class=\"p1\">Perrigo Cold &amp; Flu\r\nTablets</h3>\r\n<p class=\"p1\">This medicine is used for the relief of symptoms of colds and ­­flu, including aches and pains, headache, blocked nose, sore throat, chills and chesty coughs.</p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Tablets contains Paracetamol 250mg, Guaifenesin 100mg and Phenylephrine 5mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.</p>'),
