(1318, 109, 'columns_content_1_column_1_content', '<img class=\"alignnone wp-image-106 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-oral-1-300x254.png\" alt=\"cold-and-flu-oral\" width=\"300\" height=\"254\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu\r\nPowder for Oral Solution</h3>\r\nThis medicine is used for the short-term relief of the symptoms of colds and ­flu, including aches and pains, such as headache and sore throat, nasal congestion, chills and feverishness (high temperature). provides relief from chesty coughs, in adults and children aged 12 years and over.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Powder for Oral Solution contains Paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.</p>'),
