(1397, 121, 'columns_content_0_column_1_content', '<img class=\"aligncenter wp-image-101 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/ibuprofen-1-300x246.png\" alt=\"ibuprofen\" width=\"300\" height=\"246\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3>Perrigo Ibuprofen\r\n200mg Coated Tablets</h3>\r\nThis medicine is used for the short-term relief of mild to moderate pain such as h<strong>eadache, period pain, dental pain</strong>, and <strong>fever</strong> and <strong>pain</strong> associated with the <strong>common cold</strong>.\r\n\r\nYou must talk to a doctor if you do not feel better or if you feel worse after 3 days with fever and 4 days with pain.\r\n\r\n<hr />\r\n<p class=\"disclaimer\"><strong>Ibuprofen</strong> 200mg coated tablets contain Ibuprofen.\r\nFor Pain Relief. Always read the leaflet.</p>'),
