(1461, 127, '_columns_content_0_column_0_title', 'field_5b1122ce98d31'),
(1462, 127, 'columns_content_0_column_0_content', '<img class=\"aligncenter wp-image-100 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/paracetamol-1-300x245.png\" alt=\"paracetamol\" width=\"300\" height=\"245\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3 class=\"p1\">Perrigo Paracetamol\r\n500mg Film-Coated Tablets</h3>\r\nThis medicine is used for relief of <strong>headaches</strong>, including <strong>migraine</strong> and <strong>tension headaches, toothache, backache, rheumatic</strong> and <strong>muscle pains, neuralgia</strong> <strong>and</strong> <strong>period pain</strong>.\r\n\r\nIt also relieves <strong>feverishness, aches and pains</strong> of <strong>colds and flu</strong>. The active ingredient is paracetamol which is a painkiller and reduces your temperature when you have a <strong>fever</strong>.\r\n\r\n<hr />\r\n<p class=\"disclaimer\"><strong>Paracetamol</strong> 500mg Film-coated Tablets contain Paracetamol.\r\nFor pain relief.\r\nDo not take with any other paracetamol-containing products or with other cold or decongestant products or cough suppressants.\r\nAlways read the leaflet.</p>'),
(1463, 127, '_columns_content_0_column_0_content', 'field_5b1122d698d32'),
(1464, 127, 'columns_content_0_column_1_title', 'Ibuprofen'),
(1465, 127, '_columns_content_0_column_1_title', 'field_5b1122ce98d31'),
(1466, 127, 'columns_content_0_column_1_content', '<img class=\"aligncenter wp-image-101 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/ibuprofen-1-300x246.png\" alt=\"ibuprofen\" width=\"300\" height=\"246\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3>Perrigo Ibuprofen\r\n200mg Coated Tablets</h3>\r\nThis medicine is used for the short-term relief of mild to moderate pain such as h<strong>eadache, period pain, dental pain</strong>, and <strong>fever</strong> and <strong>pain</strong> associated with the <strong>common cold</strong>.\r\n\r\nIf this medicinal product is required for more than 3 days in the case of <strong>fever</strong> or for more than 4 days for the treatment of <strong>pain</strong>, or if the symptoms do not improve or worsen a doctor should be consulted.\r\n\r\n<hr />\r\n<p class=\"disclaimer\"><strong>Ibuprofen</strong> 200mg coated tablets contain Ibuprofen.\r\nFor Pain Relief.\r\nDo not take with any other paracetamol-containing products or with other cold or decongestant products or cough suppressants.\r\nAlways read the leaflet.</p>'),
