(1498, 128, 'pre_footer', '<p class=\"p1\"><strong>If symptoms persist consult your doctor. All information presented on these web pages is not meant to diagnose or prescribe. In all health matters for further advice please speak to your doctor or pharmacist. </strong></p>\r\n<p class=\"p1\"><strong>Paracetamol 500mg Film-coated Tablets contain Paracetamol. For pain relief. Always read the leaflet. </strong>\r\n<strong>Ibuprofen 200mg coated tablets contain Ibuprofen. For treatment of mild to moderate pain. Always read the leaflet. </strong>\r\n<strong>Perrigo Cold &amp; Flu Powder for Oral Solution contains Paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet. </strong>\r\n<strong>Perrigo Cold &amp; Flu Tablets contains Paracetamol 250mg, Guaifenesin 100mg and Phenylephrine 5mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet. </strong>\r\n<strong>Perrigo Cold &amp; Flu Multi Relief Max Powder for Oral Solution contains Paracetamol 1000mg, Guaifenesin 200mg and Phenylephrine 12.2mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet. </strong>\r\n<strong>Perrigo Cold &amp; Flu Multi Relief Capsules contains Paracetamol 500mg, Guaifenesin 100mg and Phenylephrine 6.1mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.</strong></p>'),
