(1575, 133, 'columns_content_0_column_0_content', '<img class=\"wp-image-103 size-medium alignnone\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-1-300x232.png\" alt=\"cold-and-flu\" width=\"300\" height=\"232\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n</ul>\r\n<h3 class=\"p1\">Perrigo Cold &amp; Flu\r\nTablets</h3>\r\n<p class=\"p1\">This medicine is used for the relief of symptoms of <strong>colds and ­­flu</strong>, including <strong>aches and pains, headache, blocked nose, sore throat, chills</strong> and <strong>chesty coughs</strong>.</p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Tablets contains <strong>Paracetamol</strong> 250mg, <strong>Guaifenesin</strong> 100mg and <strong>Phenylephrine</strong> 5mg. For the symptomatic relief of colds &amp; flu.\r\nDo not take with any other paracetamol-containing products or with other cold or decongestant products or cough suppressants.\r\nAlways read the leaflet.</p>'),
