INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(1579, 133, 'columns_content_0_column_1_content', '<img class=\"alignnone wp-image-104 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-multi-relief-1-300x233.png\" alt=\"cold-and-flu-multi-relief\" width=\"300\" height=\"233\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n 	<li>Sore Throat</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu\r\nMulti-Relief Capsules</h3>\r\nThis medicine is used for the relief of the symptoms of <strong>colds and flu</strong> and the <strong>pain and congestion of sinusitis</strong>, including <strong>aches and pains, headache, blocked nose and sore throat, chills</strong> and <strong>feverishness (high temperature)</strong>. It can also loosen <strong>stubborn mucus (phlegm)</strong> and provide relief from <strong>chesty coughs</strong>.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Multi Relief Capsules contains <strong>Paracetamol</strong> 500mg, <strong>Guaifenesin</strong> 100mg and <strong>Phenylephrine</strong> 6.1mg. For the symptomatic relief of colds &amp; flu.\r\nDo not take with any other paracetamol-containing products or with other cold or decongestant products or cough suppressants.\r\nAlways read the leaflet.</p>'),
