(1810, 158, 'columns_content_1_column_0_content', '<img class=\"alignnone wp-image-131 size-medium\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/07/cold-and-flu-multi-relief-oral-300x257.png\" alt=\"cold-and-flu-multi-relief-oral\" width=\"300\" height=\"257\" />\r\n<ul>\r\n 	<li>Pain</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n 	<li>Sore Throat</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu Multi-Relief Max Powder for Oral Solution</h3>\r\nThis medicine is used for the relief of the symptoms of <strong>colds and ­flu</strong> and the <strong>pain and congestion of sinusitis</strong>, including <strong>aches and pains, headache, blocked nose and sore throat, chills</strong> and <strong>feverishness (high temperature)</strong>. It can also loosen <strong>stubborn mucus (phlegm)</strong> and provide relief from <strong>chesty coughs</strong>.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Multi Relief Max Powder for Oral Solution contains Paracetamol 1000mg, Guaifenesin 200mg and Phenylephrine 12.2mg. For the symptomatic relief of colds\r\n&amp; flu.\r\nDo not take with any other paracetamol-containing\r\nproducts or with other cold or decongestant products or cough suppressants.\r\nAlways read the leaflet.</p>'),
