(1814, 158, 'columns_content_1_column_1_content', '<img class=\"alignnone wp-image-106 size-medium\" src=\"http://honeydigital.co.uk//perrigo-ireland/wp-content/uploads/2018/06/cold-and-flu-oral-1-300x254.png\" alt=\"cold-and-flu-oral\" width=\"300\" height=\"254\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu\r\nPowder for Oral Solution</h3>\r\nThis medicine is used for the short-term relief of the symptoms of <strong>colds and ­flu</strong>, including <strong>aches and pains, headache, sore throat, nasal congestion, chills, feverishness (high temperature)</strong> and provides relief from <strong>chesty coughs</strong>.\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Powder for Oral Solution contains Paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu.\r\nDo not take with any other paracetamol-containing\r\nproducts or with other cold or decongestant products or cough suppressants.\r\nAlways read the leaflet.</p>'),
