(1990, 177, '_columns_content_1_column_0_title', 'field_5b1122ce98d31'),
(1991, 177, 'columns_content_1_column_0_content', '<img class=\"alignnone wp-image-170 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/cold-and-flu-sachet-multi.png\" alt=\"cold-and-flu-sachet-multi\" width=\"415\" height=\"357\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n 	<li>Sore Throat</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu Multi-Relief Max Powder for Oral Solution</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for the relief of the symptoms of <b>colds and ­flu</b> and the <b>pain and congestion of sinusitis</b>, including <b>aches and pains, headache, blocked nose and sore throat, chills </b>and<b> feverishness (high temperature).</b> It can also loosen <b>stubborn mucus (phlegm)</b> and provide relief from <b>chesty coughs.</b></span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Multi Relief Max Powder for Oral Solution Paracetamol 1000 mg, Guaifenesin 200 mg, Phenylephrine 12.2 mg. For the relief of symptoms of colds, flu, sinusitis and chesty coughs. Do not take with any other paracetamol-containing products or with other cold, flu or decongestant products. Always read the leaflet.</p>'),
(1992, 177, '_columns_content_1_column_0_content', 'field_5b1122d698d32'),
(1993, 177, 'columns_content_1_column_1_title', 'Sachet'),
(1994, 177, '_columns_content_1_column_1_title', 'field_5b1122ce98d31'),
(1995, 177, 'columns_content_1_column_1_content', '<img class=\"alignnone wp-image-171 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/cold-and-flu-sachet.png\" alt=\"cold-and-flu-sachet\" width=\"417\" height=\"358\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu\r\nPowder for Oral Solution</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for the short-term relief of the symptoms of <b>colds and ­flu</b>, including a<b>ches and pains, headache, sore throat, nasal congestion, chills, feverishness (high temperature) </b>and provides relief from <b>chesty coughs</b>.</span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Powder for Oral Solution Paracetamol 500 mg, Guaifenesin 200 mg, Phenylephrine 10 mg. <span class=\"m_-7292122692562119339InitialStyle\">For the short-term relief of symptoms of colds, flu and </span>chesty coughs. Do not take with any other paracetamol-containing products or with other flu, cold or decongestant products. Always read the leaflet.</p>'),
(1996, 177, '_columns_content_1_column_1_content', 'field_5b1122d698d32'),
