(2001, 177, 'pre_footer', '<p class=\"p1\"><b>If symptoms persist consult your doctor. All information presented on these web pages is not meant to diagnose or prescribe. In all health matters for further advice please speak to your doctor or pharmacist. </b></p>\r\n<p class=\"p1\"><b>Paracetamol 500mg Film-coated Tablets contain Paracetamol. For pain relief. Always read the leaflet.\r\n</b><b>Ibuprofen 200mg coated tablets contain Ibuprofen. For treatment of mild to moderate pain. Always read the leaflet.\r\n</b><b>Perrigo Cold &amp; Flu Powder for Oral Solution contains Paracetamol 500mg, Guaifenesin 200mg and Phenylephrine 10mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.\r\n</b><b>Perrigo Cold &amp; Flu Tablets contains Paracetamol 250mg, Guaifenesin 100mg and Phenylephrine 5mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.\r\n</b><b>Perrigo Cold &amp; Flu Multi Relief Max Powder for Oral Solution contains Paracetamol 1000mg, Guaifenesin 200mg and Phenylephrine 12.2mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.\r\n</b><b>Perrigo Cold &amp; Flu Multi Relief Capsules contains Paracetamol 500mg, Guaifenesin 100mg and Phenylephrine 6.1mg. For the symptomatic relief of colds &amp; flu. Always read the leaflet.</b></p>'),
(2002, 177, '_pre_footer', 'field_5b11326b73669'),
(2003, 178, 'wave_type', 'red'),
(2004, 178, '_wave_type', 'field_5b227ec317282'),
(2005, 178, 'columns_content_0_column_0_title', 'Paracetamol'),
(2006, 178, '_columns_content_0_column_0_title', 'field_5b1122ce98d31'),
(2007, 178, 'columns_content_0_column_0_content', '<img class=\"aligncenter wp-image-163 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/paracetamol-01.png\" alt=\"paracetamol\" width=\"455\" height=\"375\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3 class=\"p1\">Perrigo Paracetamol\r\n500mg Film-Coated Tablets</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for short term relief of <b>headaches</b>, including <b>migraine</b> and <b>tension headaches, toothache, backache, rheumatic</b> and <b>muscle pains, neuralgia and  period pain.</b> </span></p>\r\n<p class=\"p1\"><span class=\"s1\">It also relieves <b>feverishness, aches and pains</b> of <b>colds and flu</b>. The active ingredient is paracetamol which is a painkiller and reduces your temperature when you have a <b>fever</b>.</span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\"><strong>Paracetamol</strong> 500mg Film-Coated Tablets contain paracetamol. For pain relief. Do not take with any other paracetamol containing products or with cold or decongestant products or cough suppressants. Always read the label.</p>'),
(2008, 178, '_columns_content_0_column_0_content', 'field_5b1122d698d32'),
(2009, 178, 'columns_content_0_column_1_title', 'Ibuprofen'),
(2010, 178, '_columns_content_0_column_1_title', 'field_5b1122ce98d31'),
(2011, 178, 'columns_content_0_column_1_content', '<img class=\"aligncenter wp-image-164 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/ibuprofen-01.png\" alt=\"ibuprofen\" width=\"463\" height=\"383\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Dental Pain</li>\r\n 	<li>Common Cold</li>\r\n 	<li>Period Pain</li>\r\n</ul>\r\n<h3>Perrigo Ibuprofen\r\n200mg Coated Tablets</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for the short-term relief of mild to moderate pain such as <b>headache, period pain, dental pain</b>, and <b>fever</b> and <b>pain</b> associated with the<b> common cold</b>. </span></p>\r\n<p class=\"p1\"><span class=\"s1\">If this medicinal product is required for more than 3 days in the case of <b>fever</b> or for more than 4 days for the treatment of <b>pain</b>, or if the symptoms do not improve or worsen a doctor should be consulted.</span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\"><strong>Ibuprofen</strong> 200mg coated tablets contain ibuprofen. For Pain Relief. Always read the label.</p>'),
