(2089, 202, 'columns_content_0_column_1_content', '<img class=\"alignnone wp-image-169 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/cold-and-flu-capsules.png\" alt=\"cold-and-flu-capsules\" width=\"456\" height=\"357\" />\r\n<ul>\r\n 	<li>Aches &amp; Pains</li>\r\n 	<li>Congestion</li>\r\n 	<li>Fever</li>\r\n 	<li>Chesty Cough</li>\r\n 	<li>Sore Throat</li>\r\n</ul>\r\n<h3>Perrigo Cold &amp; Flu\r\nMulti-Relief Capsules</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for the relief of the symptoms of <b>colds and flu</b> and the <b>pain and congestion of sinusitis</b>, including <b>aches and pains, headache, blocked nose and sore throat, chills </b>and<b> feverishness (high temperature).</b> It can also loosen <b>stubborn mucus (phlegm)</b> and provide relief from <b>chesty coughs</b>.</span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Perrigo Cold &amp; Flu Multi-Relief Capsules, Paracetamol 500 mg, Guaifenesin 100 mg, Phenylephrine 6.1 mg. For the relief of symptoms of colds, flu, sinusitis and chesty coughs. Do not take with any other paracetamol-containing products or with any other flu, cold, decongestant products or cough suppressants. Always read the leaflet.</p>'),
