(2123, 202, 'pre_footer', '<strong>Perrigo Cold and Flu products contain paracetamol, guaifenesin and phenylephrine. For the relief of cold and flu symptoms and chesty cough. Do not take with any other paracetamol-containing products or with any other flu, cold, decongestant products or cough suppressants. Always read the leaflet.</strong>'),
