(2138, 203, '_columns_content_0_column_0_title', 'field_5b1122ce98d31'),
(2139, 203, 'columns_content_0_column_0_content', '<img class=\"aligncenter wp-image-163 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/paracetamol-01.png\" alt=\"paracetamol\" width=\"455\" height=\"375\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Toothache</li>\r\n 	<li>Cold &amp; Flu</li>\r\n 	<li>Muscular Pain</li>\r\n</ul>\r\n<h3 class=\"p1\">Perrigo Paracetamol\r\n500mg Film-Coated Tablets</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for short term relief of <b>headaches</b>, including <b>migraine</b> and <b>tension headaches, toothache, backache, rheumatic</b> and <b>muscle pains, neuralgia and  period pain.</b> </span></p>\r\n<p class=\"p1\"><span class=\"s1\">It also relieves <b>feverishness, aches and pains</b> of <b>colds and flu</b>. The active ingredient is paracetamol which is a painkiller and reduces your temperature when you have a <b>fever</b>.</span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\"><strong>Paracetamol</strong> 500mg Film-Coated Tablets contain paracetamol. For pain relief. Do not take with any other paracetamol containing products or with cold or decongestant products or cough suppressants. Always read the label.</p>'),
