(2353, 211, 'columns_content_0_column_1_title', 'Ibuprofen'),
(2354, 211, '_columns_content_0_column_1_title', 'field_5b1122ce98d31'),
(2355, 211, 'columns_content_0_column_1_content', '<img class=\"aligncenter wp-image-164 size-full\" src=\"http://perrigoproducts.ie/wp-content/uploads/2018/09/ibuprofen-01.png\" alt=\"ibuprofen\" width=\"463\" height=\"383\" />\r\n<ul>\r\n 	<li>Headache</li>\r\n 	<li>Dental Pain</li>\r\n 	<li>Common Cold</li>\r\n 	<li>Period Pain</li>\r\n</ul>\r\n<h3>Perrigo Ibuprofen\r\n200mg Coated Tablets</h3>\r\n<p class=\"p1\"><span class=\"s1\">This medicine is used for the short-term relief of mild to moderate pain such as <b>headache, period pain, dental pain</b>, and <b>fever</b> and <b>pain</b> associated with the<b> common cold</b>. </span></p>\r\n<p class=\"p1\"><span class=\"s1\">If this medicinal product is required for more than 3 days in the case of <b>fever</b> or for more than 4 days for the treatment of <b>pain</b>, or if the symptoms do not improve or worsen a doctor should be consulted.</span></p>\r\n\r\n\r\n<hr />\r\n<p class=\"disclaimer\">Ibuprofen 200mg Coated Tablets. For short term symptomatic relief of mild to moderate pain. Always read the leaflet.</p>'),
