(8, 1, '2018-05-25 14:40:45', '2018-05-25 13:40:45', '<h1 class=\"p1\">Our Products</h1>\r\n<p class=\"p3\"><span style=\"color: #6698c8;\">Our pain products offer short-term relief of mild to moderate pain such as headaches, while our cold &amp; flu products offer relief from flu symptoms, cold symptoms, sinus pain and other pains associated with the common cold.</span></p>', 'Our Products', '', 'publish', 'closed', 'closed', '', 'our-products', '', '', '2018-10-01 10:36:40', '2018-10-01 09:36:40', '', 0, 'http://localhost/perrigo-ireland/?page_id=8', 0, 'page', '', 0),
