(10, 1, '2018-05-25 14:40:53', '2018-05-25 13:40:53', '&nbsp;\r\n<h3><span style=\"color: #0054a3;\">Perrigo Company plc is a top five global over-the-counter consumer goods and pharmaceutical business offering consumers and customers high quality products at affordable prices.</span></h3>\r\n<span style=\"color: #0054a3;\">It was founded in 1887 by Luther Perrigo in Allegan, Michigan, USA. From its beginnings as a packager of generic home remedies, Perrigo has grown to become the world’s largest manufacturer of over-the-counter products and supplier of infant formulas for the store brand market.</span>\r\n\r\n<span style=\"color: #0054a3;\">In 2015 Perrigo extended further into the European Consumer Healthcare landscape with the acquisition of Omega Pharma across Europe, including the UK and Ireland. It is now headquartered in Ireland.</span>\r\n\r\n<span style=\"color: #0054a3;\">In the UK and Ireland Perrigo is a leading provider of medicines and healthcare products Its portfolio includes consumer products, which are distributed through retail channels, and prescription medicines. It also offers specialist contract manufacturing services. Its products are sold throughout the UK, in Europe\r\nand beyond.</span>', 'About Perrigo', '', 'publish', 'closed', 'closed', '', 'about-perrigo', '', '', '2018-09-10 14:13:47', '2018-09-10 13:13:47', '', 0, 'http://localhost/perrigo-ireland/?page_id=10', 0, 'page', '', 0),
