(75, 1, '2018-06-01 14:48:46', '2018-06-01 13:48:46', '<p style=\"text-align: center;\"><span style=\"color: #000080;\"><strong>Perrigo Company plc is a top five global over-the-counter consumer goods and pharmaceutical business offering consumers and customers high quality products at affordable prices.</strong></span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #000080;\">It was founded in 1887 by Luther Perrigo in Allegan Michigan, USA. From its beginnings as a packager of generic home remedies, Perrigo has grown to become the world’s largest manufacturer of OTC products and supplier of infant formulas for the store brand market.</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #000080;\">In 2015 Perrigo extended further into the European Consumer Healthcare landscape with the acquisition of Omega Pharma across Europe, including the UK and Ireland. It is now headquartered in Ireland.</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #000080;\">In the UK and Ireland Perrigo is a leading provider of medicines and healthcare products. Its portfolio includes consumer products, which are distributed through retail channels, and prescription medicines. It also offers specialist contract manufacturing services. Its products are sold throughout the UK, in Europe and beyond.</span></p>', 'About Perrigo', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2018-06-01 14:48:46', '2018-06-01 13:48:46', '', 10, 'http://localhost/perrigo-ireland/10-revision-v1/', 0, 'revision', '', 0),
